import styled from 'styled-components';

const ChatHallBlock = styled.div`
  width: 1024px;
  height: 400px%;
  border: 1px solid black;
`;

const ChatHall = () => {
  return <ChatHallBlock>채팅홀</ChatHallBlock>;
};

export default ChatHall;
